import React, { useState, useEffect } from 'react';
import navIcons from '../../icons/navIcons';
import '../../styles/nav.component.style.scss';

function Nav() {
	let admin = {};
	return (
		<>
			<nav className="navBar flex-row">
				<div className="flex-row">
					<img src={navIcons.home} alt="" srcset="" />
					<img src={navIcons.profile} alt="" srcset="" />
					{admin && <img src={navIcons.admin} alt="" srcset="" />}
				</div>
				<div className="nav-logout flex-col">
					<button onClick={() => 'a cagar!'}>logOut</button>
				</div>
			</nav>
		</>
	);
}

export default Nav;
